package kr.co.green;

public class Operator_1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("숫자++ vs ++숫자");
		int number1 =10;
		int number2 = 10;
		int result = number1++;
		System.out.println(result);
		result = ++number2;
		System.out.println(result);
	}	

}
